pragma solidity ^0.4.10;

import "./BlockVotingDeployable.sol";

/**
  # VOTE INTEGER SIZE DECISIONS

  This governance contract has a number of optimizations built specifically for 
  the Exim blockchain.  These optimizations are based on:
    1. Quadratic voting system where voting v costs v**2 tokens
    2. A total token supply for 150M tokens
    3. Minimum requirement of 500 tokens to cast vote
  This leads to:

  - MAX SINGLE VOTE (uint16): Maximum vote is sqrt(150M)=12,247. Each 
    BallotRecord stores the vote as a uint16, which handles up to 65,536.

  - MAX TOTAL VOTE (int24): Atleast one person needs to be nominated by a voter, that voter 
    must hold 500 tokens and casts 32 votes (for 1024 tokens)for the nomination leaving: 
    150M - 500 - 1024 = 149998476 tokens in circulation. Each voter thereafter must also hold 500 tokens 
    and can cast a minimum of 1 vote with 1 token.  and  so at a max supply of 149998476, the max number 
    of votes any candidate can receive in an election is 32 + 149998476/501=299k votes, either positive or 
    negative. The nominee and governance ballots store this in the smallest 
    possible int, int24 (maxes at +/-8.35M).

  - MAX AMOUNT (uint32): If somebody held every token and used every one to vote, 
    the amount for that vote would be 150M.  The BallotRecord and NomineeBallot 
    store the amount as a uint32, the smallest uint which can hold 150M (maxes at 4.29B).

 */

contract WeylGovDeployable {
// Keeping section comments one indent out makes it easy to fold each section in VS Code (cmd+a, cmd+k+0).
////// OWNER MANAGEMENT ////////

  // State
  mapping(address => bool) private owners;
  uint public numOwners;

  // Consensus interface
  BlockVotingDeployable consensus;

  // Modifier
  modifier onlyOwner(){
      require(owners[msg.sender], "Sender must be owner.");
      _;
  }

  // Getter
  function isOwner(address maybeOwner) public constant returns (bool) {
      return owners[maybeOwner];
  }

  // Setters
  event OwnerAdded(address indexed approvingOwner, address indexed newOwner);
  function addOwner(address newOwner) public onlyOwner {
      if (owners[newOwner] == false && newOwner != address(0)){
          owners[newOwner] = true;
          numOwners += 1;
          emit OwnerAdded(msg.sender, newOwner);
      }
  }

  event OwnerRemoved(address indexed removingOwner, address indexed removedOwner);
  function removeOwner(address removedOwner) public onlyOwner {
      require(msg.sender != removedOwner, "Owners cannot remove themselves.");
      if (owners[removedOwner] == true){
          owners[removedOwner] = false;
          numOwners -= 1;
          emit OwnerRemoved(msg.sender, removedOwner);
      }
  }

////// REGISTRY MANAGEMENT /////

  // Types & State
  enum KYCStates { None, Applied, Pending, Denied, ApprovedNonGoverning, ApprovedGoverning }

  struct Registration {
      KYCStates KYCState;
      address PersonalRegistry;
  }

  mapping(address => Registration) private registry;
  uint public numRegistered;

  // Getters
  function getRegistration(address registrant)
  public constant returns (KYCStates, address) {
      return (registry[registrant].KYCState, registry[registrant].PersonalRegistry);
  }

  function hasApplied(address registrant) public constant returns (bool) {
      return registry[registrant].KYCState != KYCStates.None;
  }

  function isKYCPending(address registrant) public constant returns (bool) {
      return registry[registrant].KYCState == KYCStates.Pending;
  }

  function isKYCApproved(address registrant) public constant returns (bool) {
      return registry[registrant].KYCState == KYCStates.ApprovedNonGoverning || registry[registrant].KYCState == KYCStates.ApprovedGoverning;
  }

  function isKYCDenied(address registrant) public constant returns (bool) {
      return registry[registrant].KYCState == KYCStates.Denied;
  }

  function canGovern(address registrant) public constant returns (bool) {
      return registry[registrant].KYCState == KYCStates.ApprovedGoverning;
  }

  // Modifiers
  modifier ApplicationExists(address registrant){
      require(hasApplied(registrant), "Registrant must have already applied before this can be called.");
      _;
  }

  modifier KYCPending(address registrant){
      require(isKYCPending(registrant), "Registrant's KYC must be pending when this is called.");
      _;
  }

  // Setters
  event UpdatedPersonalRegistry(address indexed updatingEntry, address indexed newRegistry);
  function updatePersonalRegistry(address newRegistry) public ApplicationExists(msg.sender) {
      registry[msg.sender].PersonalRegistry = newRegistry;
      emit UpdatedPersonalRegistry(msg.sender, newRegistry);
  }

  event AppliedKYC(address indexed newEntry);
  function applyKYC() public {
      require(registry[msg.sender].KYCState == KYCStates.None, "applyKYC can only be called by senders with no existing record.");
      registry[msg.sender] = Registration(KYCStates.Applied, address(0));
      numRegistered += 1;
      emit AppliedKYC(msg.sender);
  }

  event DeletedKYC(address indexed removingOwner, address indexed removedEntry, uint8 finalKYC, address finalPersonalRegistry);
  function deleteKYC(address registrant) 
  public onlyOwner ApplicationExists(registrant) {
      uint8 finalKYC = uint8(registry[registrant].KYCState);
      address finalPersonalRegistry = registry[registrant].PersonalRegistry;
      delete registry[registrant];
      numRegistered -= 1;
      emit DeletedKYC(msg.sender, registrant, finalKYC, finalPersonalRegistry);
  }

  event ProcessedKYC(address indexed approvingOwner, address indexed pendingEntry);
  function processKYC(address registrant) public onlyOwner {
      require(registry[registrant].KYCState == KYCStates.Applied, "processKYC can only be called on registrants in the Applied state.");
      registry[registrant].KYCState = KYCStates.Pending;
      emit ProcessedKYC(msg.sender, registrant);
  }

  event ApprovedKYC(address indexed approvingOwner, address indexed approvedEntry);
  function approveKYC(address registrant)
  public onlyOwner KYCPending(registrant) {
      registry[registrant].KYCState = KYCStates.ApprovedNonGoverning;
      emit ApprovedKYC(msg.sender, registrant);
  }

  event RevokedKYC(address indexed revertingOwner, address indexed entry);
  function revokeKYC(address registrant) public onlyOwner {
      require(isKYCApproved(registrant), "revokeKYC can only be called on registrants with approved KYC.");
      registry[registrant].KYCState = KYCStates.Denied;
      consensus = BlockVotingDeployable(0x0000000000000000000000000000000000000020);
      if (consensus.isBlockMaker(registrant)){
          consensus.removeBlockMaker(registrant);
      }
      emit RevokedKYC(msg.sender, registrant);
  }

  event DeniedKYC(address indexed denyingOwner, address indexed deniedEntry);
  function denyKYC(address registrant) 
  public onlyOwner KYCPending(registrant) {
      registry[registrant].KYCState = KYCStates.Denied;
      emit DeniedKYC(msg.sender, registrant);
  }

  event AppealedKYC(address indexed appealingRegistrant);
  function appealKYC() public {
      require(isKYCDenied(msg.sender), "appealKYC can only be called by registrants whose KYC is Denied.");
      registry[msg.sender].KYCState = KYCStates.Pending;
      emit AppealedKYC(msg.sender);
  }

  event ApprovedGoverning(address indexed approvingOwner, address indexed voter);
  function approveGoverning(address registrant) public onlyOwner {
      require(registry[registrant].KYCState == KYCStates.ApprovedNonGoverning, "approveGoverning can only be called on registrants who are ApprovedNonGoverning.");
      registry[registrant].KYCState = KYCStates.ApprovedGoverning;
      emit ApprovedGoverning(msg.sender, registrant);
  }

  event RevokedGoverning(address indexed revokingOwner, address indexed nonvoter);
  function revokeGoverning(address registrant) public onlyOwner {
      require(registry[registrant].KYCState == KYCStates.ApprovedGoverning, "revokeGoverning can only be called on registrants who are ApprovedGoverning.");
      registry[registrant].KYCState = KYCStates.ApprovedNonGoverning;
      consensus = BlockVotingDeployable(0x0000000000000000000000000000000000000020);
      if (consensus.isBlockMaker(registrant)){
          consensus.removeBlockMaker(registrant);
      }
      emit RevokedGoverning(msg.sender, registrant);
  }

  event RegisteredGoverning(address indexed registeringOwner, address indexed voter);
  function registerGoverning(address registrant) public onlyOwner {
      require(registry[registrant].KYCState == KYCStates.None, "registerGoverning can only be called on registrants with NoRecord.");
      registry[registrant].KYCState = KYCStates.ApprovedGoverning;
      registry[registrant].PersonalRegistry = address(0);
      numRegistered += 1;
      emit RegisteredGoverning(msg.sender, registrant);
  }

  event RegisteredNonGoverning(address indexed registeringOwner, address indexed nonvoter);
  function registerNonGoverning(address registrant) public onlyOwner {
      require(registry[registrant].KYCState == KYCStates.None, "registerNonGoverning can only be called on registrants with NoRecord.");
      registry[registrant].KYCState = KYCStates.ApprovedNonGoverning;
      registry[registrant].PersonalRegistry = address(0);
      numRegistered += 1;
      emit RegisteredNonGoverning(msg.sender, registrant);
  }

////// GOVERNANCE CYCLES ///////
  uint8 constant GovernanceCycleNoRecord = 0;
  uint8 constant GovernanceCycleStarted = 1;
  uint8 constant GovernanceCycleCompleted = 2;
  mapping(uint => GovernanceCycle) public governanceCycleRecords;
  uint public currentGovernanceCycle;

  enum GovernanceCycleStatus {
      NoRecord,
      Started,
      Completed
  }

  struct GovernanceCycle{
    uint32 totalPayments;
    uint8 status;
    int24 electionVotesElected;
    int24 evictionVotesEvicted;
    uint24 totalVoters;
    uint[] ballotIds;
    address elected;
    address evicted;
    uint256 start;
  }

  // Average month accounts for varying month lengths and February 29th:
  // ((365 d/y)*(4y)+(1d))/(48mo/y) = 30.4375d = 43830min
  uint256 constant public AverageMonth = 43830 minutes;
  uint256 constant public GovernanceCycleDelayFloor = 24 hours;
  uint256 constant public GovernanceCycleDelayCeiling = 3 * AverageMonth;
  uint256 public GovernanceCycleDelay = (60 seconds);
  event GovernanceCycleDelayUpdated(uint256 _delayInSeconds);
  function setGovernanceCycleDelay(uint256 delayInSeconds) public onlyOwner {
    require(delayInSeconds >= GovernanceCycleDelayFloor && delayInSeconds <= GovernanceCycleDelayCeiling);
    GovernanceCycleDelay = delayInSeconds;
    emit GovernanceCycleDelayUpdated(delayInSeconds);
  }

  event CycleStarted(uint256 cycleId);
  event CycleFinalized(uint256 cycleId);
  function newGovernanceCycle() public {
    populateGovernanceCycleRecord();
    emit CycleStarted(currentGovernanceCycle);
  }

  function findWinners() public constant returns (address, int24, address, int24) {
    address electionWinner = address(0);
    int24 electionWinnerCount = 0;
    address evictionWinner = address(0);
    int24 evictionWinnerCount = 0;
    for (uint16 i = 0; i < nomineesInCycle; i++){
      if (nomineeBallots[nomineeBallotKeys[i]].election){
        if (nomineeBallots[nomineeBallotKeys[i]].votes > electionWinnerCount){
          electionWinner = nomineeBallotKeys[i];
          electionWinnerCount = nomineeBallots[nomineeBallotKeys[i]].votes;
        }
      } else {
        if (nomineeBallots[nomineeBallotKeys[i]].votes > evictionWinnerCount){
          evictionWinner = nomineeBallotKeys[i];
          evictionWinnerCount = nomineeBallots[nomineeBallotKeys[i]].votes;
        }
      }
    }
    return (electionWinner, electionWinnerCount, evictionWinner, evictionWinnerCount);
  }

  function finalizeGovernanceCycle() public {
    GovernanceCycle storage latestGovernanceCycle = governanceCycleRecords[currentGovernanceCycle];
    require(latestGovernanceCycle.status==GovernanceCycleStarted, "Cycles must be started before they can be finalized.");
    require(now >= latestGovernanceCycle.start + GovernanceCycleDelay, "Cycles can only be closed after the full GovernanceCycleDelay has passed.");
    address electionWinner;
    address evictionWinner;
    int24 electionWinnerCount;
    int24 evictionWinnerCount;
    (electionWinner, electionWinnerCount, evictionWinner, evictionWinnerCount) = findWinners();
    latestGovernanceCycle.elected = electionWinner;
    latestGovernanceCycle.electionVotesElected = electionWinnerCount;
    latestGovernanceCycle.evicted = evictionWinner;
    latestGovernanceCycle.evictionVotesEvicted = evictionWinnerCount;
    latestGovernanceCycle.status = GovernanceCycleCompleted;
    executeGovernance();
    nomineesInCycle = 0;
    electionNomineesInCycle = 0;
    evictionNomineesInCycle = 0;
    emit CycleFinalized(currentGovernanceCycle);
  }

  event AddedBlockMaker(address newMaker, uint256 cycleId);
  event RemovedBlockMaker(address oldMaker, uint256 cycleId);
  function executeGovernance() private {
    require(governanceCycleRecords[currentGovernanceCycle].status == GovernanceCycleCompleted, "executeGovernance can only be called when the current cycle is Completed.");
    address electedBlockMaker = governanceCycleRecords[currentGovernanceCycle].elected;
    address evictedBlockMaker = governanceCycleRecords[currentGovernanceCycle].evicted;
    consensus = BlockVotingDeployable(0x0000000000000000000000000000000000000020);
    if (electedBlockMaker != address(0)){
      consensus.addBlockMaker(electedBlockMaker);
      emit AddedBlockMaker(electedBlockMaker, currentGovernanceCycle);
    }
    if (evictedBlockMaker != address(0)){
      consensus.removeBlockMaker(evictedBlockMaker);
      emit RemovedBlockMaker(evictedBlockMaker, currentGovernanceCycle);
    }
  }

  function populateGovernanceCycleRecord() internal returns (GovernanceCycle storage record, uint256 index) {
    GovernanceCycle memory latestGovernanceCycle = governanceCycleRecords[currentGovernanceCycle];
    if (currentGovernanceCycle == 0 && latestGovernanceCycle.status == GovernanceCycleNoRecord){
      GovernanceCycle storage burnGovernanceCycle = governanceCycleRecords[currentGovernanceCycle];
      burnGovernanceCycle.status = GovernanceCycleCompleted;
      burnGovernanceCycle.start = now;
      return (record, index);
    } else {
      require(latestGovernanceCycle.status == GovernanceCycleCompleted, "Latest cycle must be Completed before opening a new one.");
      require(now >= latestGovernanceCycle.start + GovernanceCycleDelay, "Full GovernanceCycleDelay must pass before opening new cycle.");
      index = currentGovernanceCycle+1;
      record = governanceCycleRecords[index];
      require(record.status == GovernanceCycleNoRecord, "Newest record must be in NoRecord zero state.");
      record.status = GovernanceCycleStarted;
      record.start = now;
      currentGovernanceCycle ++;
      return (record, index);
    }

  }

////// BALLOTS /////////////////

  struct BallotRecord {
        uint governanceCycleId;
        address voter;
        address voted_for;
        uint256 withdrawRecordId;
        uint256 timestamp;
        uint32 amount;
        uint16 votes;
        bool election;
        bool inSupport;
        bool withdrawRecord;
  }

  struct NomineeBallot{
    uint governanceCycleId;
    bool election;
    int24 votes;
    uint24 positiveVotes;
    uint24 negativeVotes;
    uint24 totalVoters;
    uint[] nominationsPastGovernanceCycles;
  }

  mapping(address => NomineeBallot) public nomineeBallots;
  address[] public nomineeBallotKeys;
  mapping (uint => BallotRecord) public ballotRecords;
  mapping (address => uint[]) public ballotHistory;
  mapping (address => uint) public latestGovernanceCycleParticipated;
  uint public ballotIndex;

  uint16 public nomineesInCycle;
  uint16 public electionNomineesInCycle;
  uint16 public evictionNomineesInCycle;

  // Floor is same as minimum vote, ceiling is 2^13, which works
  // out to roughly 1 basis point of the total token supply.
  uint256 public constant NominationFeeFloor = 1;
  uint256 public constant NominationFeeCeiling = 16383;
  uint256 public NominationFee = 1024;
  event NominationFeeUpdated(uint256 _newFee);
  function setNominationFee(uint feeInEXC) public onlyOwner {
      require(feeInEXC >= NominationFeeFloor && feeInEXC <= NominationFeeCeiling);
      NominationFee = feeInEXC;
      emit NominationFeeUpdated(feeInEXC);
  }

  // Ceiling is current value, as any higher could lead to
  // excessive finalization costs.  Minimum is 256, requiring
  // large coordination to fill the pool.
  uint16 public constant maxNomineesInCycleFloor = 256;
  uint16 public constant maxNomineesInCycleCeiling = 1024;
  uint16 public maxNomineesInCycle = 1024;
  event MaxNomineesUpdated(uint16 _newMaxNominees);
  function setMaxNominees(uint16 maxNominees) public onlyOwner {
      require(maxNominees >= maxNomineesInCycleFloor && maxNominees <= maxNomineesInCycleCeiling);
      maxNomineesInCycle = maxNominees;
      emit MaxNomineesUpdated(maxNominees);
  }

  event Voted(address _voter, uint256 _ballotIndex, address _voted_for, bool _election, bool _inSupport, uint16 _votes);
  function vote(address _voted_for, bool _election, bool _inSupport, uint16 _votes) public payable returns (uint256 index){
    // Max supply is 150M "ether", so max vote is sqrt(150M)=12.2k. uint16 maxes at 65.3k. uint32 maxes at 4.2B.
    assert(msg.value < (150000000 * 1 ether));
    assert(_votes < 12247);
    // Casting each vote up to 32 bytes ensures we don't get an overflow
    require(msg.sender.balance > (500 * 1 ether), "Voters must have at least 500 EXC.");
    require(currentGovernanceCycle > 0, "Users cannot vote on the zeroth cycle.");
    uint128 _amount = uint128(msg.value/1 ether);
    require(uint128(_votes)*uint128(_votes) <= _amount, "The vote value must be at least the square of its weight.");
    require(nomineesInCycle < maxNomineesInCycle, "There can be no more than 1,024 nominees in each cycle.");
    require(canGovern(_voted_for), "The voted_for address must already be approved for governing.");
    require(canGovern(msg.sender), "The voting address must already be approved for governing.");
    require(_amount >= 1, "Vote weights cannot be less than 1.");

    BallotRecord memory record;
    (record, ballotIndex) = populateBallotRecord(_voted_for,  _election,  _inSupport,  uint32(_amount),  _votes);
    emit Voted(msg.sender, ballotIndex, _voted_for, _election, _inSupport, _votes);
    return ballotIndex;
  }

  function populateBallotRecord(address _voted_for, bool _election, bool _inSupport, uint32 _amount, uint16 _votes) internal returns (BallotRecord storage record, uint256 index) {
    require (latestGovernanceCycleParticipated[msg.sender] < currentGovernanceCycle, "Voters can only vote once per cycle.");
    require(canGovern(msg.sender), "Voting addresses must already be approved for governing.");
    latestGovernanceCycleParticipated[msg.sender] = currentGovernanceCycle;

    index = ballotIndex+1;
    record = ballotRecords[index];

    GovernanceCycle storage governanceCycleRecord = governanceCycleRecords[currentGovernanceCycle];
    NomineeBallot storage nomineeBallotRecord = nomineeBallots[_voted_for];

    // This check shows that the vote for this nominee is the first one in this governanceCycle,
    // and is therefore a nomination.  Nominations (i.e. first vote in cycle for a candidate)
    // requires updates to both the nominee's ballot and the record of all nominations in cycle. 
    consensus = BlockVotingDeployable(0x0000000000000000000000000000000000000020);
    if (nomineeBallotRecord.governanceCycleId != currentGovernanceCycle) {
      require(_amount >= NominationFee, "The minimum weight to nominate an address is 32, a vote cost of 1024 EXC.");
      if (nomineeBallotKeys.length == nomineesInCycle){
        nomineeBallotKeys.push(_voted_for);
      } else {
        nomineeBallotKeys[nomineesInCycle] = _voted_for;
      }

      // Update nominee counts
      nomineesInCycle ++;
      if (_election == true){
        electionNomineesInCycle ++;
      } else {
        evictionNomineesInCycle ++;
      }

      // Clear off any previous state as we know this is a nomination
      nomineeBallotRecord.governanceCycleId = currentGovernanceCycle;
      nomineeBallotRecord.election = _election;
      nomineeBallotRecord.votes = 0;
      nomineeBallotRecord.positiveVotes = 0;
      nomineeBallotRecord.negativeVotes = 0;
      nomineeBallotRecord.totalVoters = 0;
      nomineeBallotRecord.nominationsPastGovernanceCycles.push(currentGovernanceCycle);

    } else if (_election == true) {
      // This clause is only reached for non-nominating votes, once the nomination has already
      // updated the nominee's ballot to this cycle.  In elections, only blockmakers can vote
      // on existing nominees.
      require(consensus.isBlockMaker(msg.sender), "Only current blockmakers may vote on nominees to join the pool.");
    }

    // Verify the nominee has appropriate blockmaker status for election/eviction
    if (_election == true) {
      require(!consensus.isBlockMaker(_voted_for));
    } else {
      require(consensus.isBlockMaker(_voted_for));
    }
    assert(nomineeBallotRecord.governanceCycleId == currentGovernanceCycle);
    require (governanceCycleRecord.status == GovernanceCycleStarted, "Votes can only be made when the current cycle has been started.");

    record.governanceCycleId = currentGovernanceCycle;
    record.voter = msg.sender;
    record.voted_for = _voted_for;
    record.election = _election;
    record.inSupport = _inSupport;
    record.amount = _amount;
    record.votes = _votes;
    record.timestamp = now;

    // UPDATE NOMINEE BALLOT RECORDS
    // Each BallotRecord stores _votes as a uint16, but the NomineeBallot maintains
    // the running tally as an int24, so we convert the values before performing
    // math.  Important that we cast to an int24 rather than an int16, as an int16
    // only supports half the positive range that a uint16 does.  We cast to uint24
    // for positive/negative because that's what they will be stored in, and it seems
    // best to operate on types of the same size.
    nomineeBallotRecord.totalVoters ++;
    if ( _election) {
      assert(nomineeBallotRecord.election == true);
      if (_inSupport) {
        nomineeBallotRecord.votes += int24(_votes);
        nomineeBallotRecord.positiveVotes += uint24(_votes);
      } else {
        nomineeBallotRecord.votes -= int24(_votes);
        nomineeBallotRecord.negativeVotes += uint24(_votes);
      }
    } else {
      assert(nomineeBallotRecord.election == false);
      if (_inSupport) {
        nomineeBallotRecord.votes += int24(_votes);
        nomineeBallotRecord.positiveVotes += uint24(_votes);
      } else {
        nomineeBallotRecord.votes -= int24(_votes);
        nomineeBallotRecord.negativeVotes += uint24(_votes);
      }
    }

    governanceCycleRecord.totalPayments += _amount;
    governanceCycleRecord.totalVoters ++;
    ballotIndex++;
    ballotHistory[msg.sender].push(index);
    return (record, index);
  }

////// WITHDRAWALS /////////////

  //using SafeMath for uint256;
  uint8 constant WithdrawStatusNoRecord = 0;
  uint8 constant WithdrawStatusStarted = 1;
  uint8 constant WithdrawStatusCompleted = 2;
  event WithdrawStartedEvent(uint256 _withdrawIndex,
                                address  _voter,
                                uint256 _governanceCycleId,
                                uint256 _ballotId);
  event WithdrawFinalizedEvent(uint256 _withdrawIndex,
                                address _voter,
                                uint256 _governanceCycleId,
                                uint256 _ballotId);

  enum WithdrawStatus {
      NoRecord,
      Started,
      Completed
  }

  struct WithdrawRecord {
      uint32 amount;
      uint8 status;
      uint governanceCycleId;
      address beneficiary;
      uint256 ballotId;
      uint256 timestamp;
  }

  mapping(uint => WithdrawRecord) public withdrawRecords;
  mapping (address => uint[]) public withdrawHistory;
  uint public withdrawRecordsIndex;

  uint256 public constant WithdrawDelayFloor = (0 seconds);
  uint256 public constant WithdrawDelayCeiling = AverageMonth;
  uint256 public WithdrawDelay = (60 seconds);
  event WithdrawDelayUpdated(uint256 delayInSeconds);
  function setWithdrawDelay(uint delayInSeconds) public onlyOwner {
      require(delayInSeconds >= WithdrawDelayFloor && delayInSeconds <= WithdrawDelayCeiling);
      WithdrawDelay = delayInSeconds;
      emit WithdrawDelayUpdated(delayInSeconds);
  }

  function startWithdraw(uint _governanceCycleId, uint _ballotId) public returns(bool ok, uint index) {
    WithdrawRecord memory record;
    (record, index) = populateWithdrawRecord(_governanceCycleId, _ballotId);
    ok = true;
    emit WithdrawStartedEvent(index, msg.sender, _governanceCycleId, _ballotId);
    return (ok, index);
  }

  function populateWithdrawRecord(uint _governanceCycleId, uint _ballotId) internal returns (WithdrawRecord storage record, uint256 index) {
    GovernanceCycle memory governanceCycleRecord = governanceCycleRecords[_governanceCycleId];
    BallotRecord storage ballotRecord = ballotRecords[_ballotId];

    require(governanceCycleRecord.status == GovernanceCycleCompleted, "Ballot's cycle must be completed before beginning a withdrawal.");
    require(ballotRecord.voter == msg.sender, "Voters can only begin withdrawals on their own ballots.");
    require(ballotRecord.governanceCycleId == _governanceCycleId, "Ballot must be from the specified governance cycle.");
    require(ballotRecord.withdrawRecord == false, "Ballot cannot already have a withdrawal record.");
    require(ballotRecord.withdrawRecordId == 0, "Ballot's withdrawalRecordId must be at initial zero value.");

    index = withdrawRecordsIndex+1;
    record = withdrawRecords[index];

    ballotRecord.withdrawRecord = true;
    ballotRecord.withdrawRecordId = index;

    assert(record.status == WithdrawStatusNoRecord);

    record.status = WithdrawStatusStarted;
    record.governanceCycleId = _governanceCycleId;
    record.ballotId = _ballotId;
    record.beneficiary = msg.sender;
    record.amount = governanceCycleRecord.totalPayments / governanceCycleRecord.totalVoters;
    record.timestamp = now;

    withdrawRecordsIndex ++;
    withdrawHistory[msg.sender].push(index);
    return (record, index);
  }

  function finalizeWithdraw(uint256 _withdrawIndex) public returns(bool success) {
    WithdrawRecord storage record = withdrawRecords[_withdrawIndex];
    require(canGovern(msg.sender), "Addresses which have lost their governing privileges may not finalize any withdrawals.");
    require(record.status == WithdrawStatusStarted, "Withdrawal must have been started before finalizing.");
    require(now >= record.timestamp + WithdrawDelay, "Full WithdrawalDelay must have passed since starting before finalizing.");
    record.status = WithdrawStatusCompleted;
    record.timestamp = now;

    uint256 toSend = uint128(record.amount) * 1 ether;
    record.beneficiary.transfer(toSend);

    emit WithdrawFinalizedEvent(_withdrawIndex, record.beneficiary, record.governanceCycleId, record.ballotId);

    return true;
  }

